import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';

const comment = {
    date: new Date(),
    text: 'I hope you enjoy',
    author: {
      name: 'hello kitty',
      avatarUrl: 'https://placekitten.com/g/64/64',
    }
  }
ReactDOM.render(<App comment={comment} />, document.getElementById('root'));
